import React from 'react';
import Baner from './Baner/Baner';
import Board from './Board/Board';
import {board} from '../../data/imageData';

var el = document.querySelector( 'body' );
const counter = 0;

function changeImg() {
    counter = counter + 1;
}

console.log(counter);

el.addEventListener("click", changeImg());

const GameWrapper = () => (
    <div>
        <Baner />
        <Board 
            desc = {board[counter].description}
            img = {board[counter].image}
        />
    </div>
);

export default GameWrapper;
